import React, {useState} from 'react';
import logo from './logo.png'; 
import RadioComponent from './RadioComponent';


function App() {

  /*+ refactor + comments + names_change*/

  const [nervous, setNervous] = useState("")
  const [sport, setSport] = useState("")
  const [happy, setHappy] = useState("")
  const [tired, setTired] = useState("")

  const [alertDiv, setAlertDiv] = useState("alert alert-warning alert-dismissible d-none fade")
  const [txt, setText] = useState("")

  const [invalidNervous, setInvalidNervous] = useState("form-check-input")
  const [invalidSport, setInvalidSport] = useState("form-check-input")
  const [invalidHappy, setInvalidHappy] = useState("form-check-input")
  const [invalidTired, setInvalidTired] = useState("form-check-input")

  const [sliderValue, setSliderValue] = useState(0);


  const handleSubmit = (e) => {
    e.preventDefault()

    let countInvalid = 0;
    let countData = 0;

    if(nervous === "") {
      setInvalidNervous("form-check-input is-invalid")
      countInvalid = 1
    } else {
      if (nervous === "yes") {
        countData = countData + 1
      }
      setInvalidNervous("form-check-input")
    }

    if(sport === "") {
      setInvalidSport("form-check-input is-invalid")
      countInvalid = 1
    } else {
      if (sport === "yes") {
        countData = countData + 1
      }
      setInvalidSport("form-check-input")
    }

    if(happy === "") {
      setInvalidHappy("form-check-input is-invalid")
      countInvalid = 1
    } else {
      if (happy === "yes") {
        countData = countData + 1
      }
      setInvalidHappy("form-check-input")
    }

    if(tired === "") {
      setInvalidTired("form-check-input is-invalid")
      countInvalid = 1
    } else {
      if (tired === "yes") {
        countData = countData + 1
      }
      setInvalidTired("form-check-input")
    }

    if (sliderValue >= 5) {
      countData = countData + 1
    }



    if (countInvalid === 0) {
      if (countData > 3) {
        setText("It looks like you're going to have a good day :)")
        setAlertDiv("alert alert-success alert-dismissible w-25 mx-auto fade show")
      } else {
        setText("It looks like you're going to have a bad day :(")
        setAlertDiv("alert alert-danger alert-dismissible w-25 mx-auto fade show")
      }
    }
  }

  function hideAlert() {
    setAlertDiv("alert alert-success alert-dismissible w-25 mx-auto d-none fade")
  }

  return (
    <>
      <nav class="navbar navbar-dark bg-dark">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
            <img src={logo} alt="" width="30" height="24" class="d-inline-block align-text-top mx-2" />
             we care.
          </a>
        </div>
      </nav>

      <h1 class="fw-bold mx-5 my-5 text-center" data-end=".">tell us how do you feel</h1>

      <div class={alertDiv} role="alert">
        {txt}
        <button type="button" class="btn-close btn-close" aria-label="Close" onClick={hideAlert}></button>
      </div>

      <form class="w-25 mx-auto" onSubmit={handleSubmit}>
        <div class="form-group input-group-lg mb-3">
          <label for="formGroupExampleInput" class="h5">On scale from 0 to 10 how do you feel these days?</label>
          <input type="range" class="form-range" id="slider1" min="0" max="10" value={sliderValue} onChange={e => setSliderValue(e.target.value)}/>
        </div>

        <div class="form-group input-group-lg mb-3">
          <label for="formGroupExampleInput" class="h5">How many hours did you sleep last night?</label>
          <select class="form-select">
            <option value="1" selected>0 to 4 hours</option>
            <option value="2">5 to 8 hours</option>
            <option value="3">9 and more hours</option>
          </select>
        </div>


        <RadioComponent txt="Do you feel nervous these days?" class={invalidNervous} fun={setNervous}/>
        <RadioComponent txt="Did you do any sports last week?" class={invalidSport} fun={setSport}/>
        <RadioComponent txt="Do you feel happy?" class={invalidHappy} fun={setHappy}/>
        <RadioComponent txt="Do you feel tired" class={invalidTired} fun={setTired}/>




        <div class="form-group input-group-lg mb-3">
          <label for="formGroupExampleInput" class="h5">Do you feel happy?</label>
          <div class="form-check">
            <input class={invalidHappy} type="radio" name="RadioHappy" id="RadioHappyYes" value="yes" onChange={e=>setHappy(e.target.value)}/>
            <label class="form-check-label" for="RadioHappy">
              Yes
            </label>
          </div>
          <div class="form-check">
            <input class={invalidHappy} type="radio" name="RadioHappy" id="RadioHappyNo" value="no" onChange={e=>setHappy(e.target.value)}/>
            <label class="form-check-label" for="RadioHappy">
              No
            </label>
            <div class="invalid-feedback">Please choose an option.</div>
          </div>
        </div>

        <div class="form-group input-group-lg mb-3">
          <label for="formGroupExampleInput" class="h5">Do you feel tired?</label>
          <div class="form-check">
            <input class={invalidTired} type="radio" name="RadioTired" id="RadioTiredYes" value="yes" onChange={e=>setTired(e.target.value)}/>
            <label class="form-check-label" for="RadioTired">
              Yes
            </label>
          </div>
          <div class="form-check">
            <input class={invalidTired} type="radio" name="RadioTired" id="RadioTiredNo" value="no" onChange={e=>setTired(e.target.value)}/>
            <label class="form-check-label" for="RadioTired">
              No
            </label>
            <div class="invalid-feedback">Please choose an option.</div>
          </div>
        </div>

        <button type="submit" class="btn btn-primary">Submit</button>

      </form>
    </>
  )
}

export default App;
